import PropTypes from 'prop-types';


const Dribbble = ({dribbbleData}) => {
    return(
        <div>
            {dribbbleData.map((data, index) => {
                <div key={index}>
                    {data.data}
                </div>
            })}
        </div>
    )
}

Dribbble.propType = {
    dribbbleData: PropTypes.array
}

export default Dribbble;
